/** @format */

import React from 'react';
import { ShowcaseDishes } from './TextInfo';

const Gallery = () => {
	return (
		<div className='container_page'>
			<span className='gallery'>
				{ShowcaseDishes.map((item, index) => {
					const background = { backgroundImage: 'url(../images/bck.jpg)' };
					return item.type == 'Showcased Dishes' ? (
						<span className='gallery-item' key={index}>
							<p>{item.type}</p>
						</span>
					) : (
						<span className='gallery-item' style={background} key={index}>
							<p>{item.type}</p>
						</span>
					);
				})}
			</span>
		</div>
	);
};

export default Gallery;
